import React, { useState } from "react";

const Registracija = () => {
    const [ime, setIme] = useState('');
    const [prezime, setPrezime] = useState('');
    const [adresa, setAdresa] = useState('');
    const [post_broj, setPost_broj] = useState('');
    const [mjesto, setMjesto] = useState('');
    const [kontakt, setKontakt] = useState('');
    const [email, setEmail] = useState('');
    const [kor_ime, setKor_ime] = useState('');
    const [lozinka, setLozinka] = useState('');

    const addKlijentProHandler = () => {

    }

    return (
        <>
            <h1 className="d-grid gap-2 col-6 mx-auto">Registracija</h1>
            <div class="d-grid gap-2 col-6 mx-auto">

<Form onSubmit={addKlijentProHandler}> 
                <div class="mb-3">
                    <label for="Ime" class="form-label">Ime: </label>
                    <input type="Ime" class="form-control" id="Ime" placeholder="Ivan"
                        value={ime}
                        onChange={(e) => setIme(e.target.value)} />
                </div>
                <div class="mb-3">
                    <label for="Prezime" class="form-label">Prezime: </label>
                    <input type="text" class="form-control" id="Prezime" placeholder="Horvat"
                        value={prezime}
                        onChange={(e) => setPrezime(e.target.value)}
                    />
                </div>
                <div class="mb-3">
                    <label for="Adresa" class="form-label">Adresa: </label>
                    <input type="text" class="form-control" id="Adresa" placeholder="Ulica Straha 1"
                        value={adresa}
                        onChange={(e) => setAdresa(e.target.value)}
                    />
                </div>
                <div class="mb-3">
                    <label for="Post_broj" class="form-label">Poštanski broj: </label>
                    <input type="text" class="form-control" id="Post_broj" placeholder="10000"
                        value={post_broj}
                        onChange={(e) => setPost_broj(e.target.value)}
                    />
                </div>
                <div class="mb-3">
                    <label for="Mjesto" class="form-label">Mjesto: </label>
                    <input type="text" class="form-control" id="Mjesto" placeholder="Zagreb"
                        value={mjesto}
                        onChange={(e) => setMjesto(e.target.value)}
                    />
                </div>
                <div class="mb-3">
                    <label for="Kontakt" class="form-label">Kontakt: </label>
                    <input type="text" class="form-control" id="Kontakt" placeholder="0958517126"
                        value={kontakt}
                        onChange={(e) => setKontakt(e.target.value)}
                    />
                </div>
                <div class="mb-3">
                    <label for="Email" class="form-label">Email adresa: </label>
                    <input type="text" class="form-control" id="Email" placeholder="name@example.com"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                    />
                </div>
                <div class="mb-3">
                    <label for="Kor_ime" class="form-label">Željeno korisničko ime: </label>
                    <input type="text" class="form-control" id="Kor_ime" placeholder="Korisničko ime"
                        value={kor_ime}
                        onChange={(e) => setKor_ime(e.target.value)}
                    />
                </div>
                <label for="Lozinka" class="form-label">Lozinka: </label>
                <input type="Password" id="Lozinka" class="form-control" aria-describedby="passwordHelpBlock"
                    value={lozinka}
                    onChange={(e) => setLozinka(e.target.value)}
                />
                <div id="passwordHelpBlock" class="form-text"> </div>
                <div class="d-grid gap-2 col-6 mx-auto">
                    <button type="button" className="btn btn-outline-dark ms-2" data-bs-toggle="modal" data-bs-target="#loginModal">
                        <i className="fa fa-sign-in me-2"></i>Registracija
                    </button>
                </div>
                </Form>
            </div>


        </>
    )
}
export default Registracija;
